import quotes from './quotes'

function netReturn(company) {
    var currentTimeInSeconds=Math.floor(Date.now()/1000);
    var endTime = currentTimeInSeconds - 86400
    const finnhub = require('finnhub');
    var net = 0
    var today = quotes(company)

    const api_key = finnhub.ApiClient.instance.authentications['api_key'];
    api_key.apiKey = "c7qobl2ad3ia6nr4s5o0"
    const finnhubClient = new finnhub.DefaultApi()

    finnhubClient.stockCandles(company, "D", endTime, endTime, (error, data, response) => {
        console.log("today:")
        console.log(today)
        var yesterday = data.c
        console.log("yesterday:")
        console.log(yesterday)
        net = today - yesterday
    });
    console.log(net)
    return net
}

export default netReturn;
